// ==UserScript==
// @name         Messenger Old Favicon
// @namespace    https://greasyfork.org/en/users/8615-joeytwiddle
// @version      0.0.1
// @description  Make Messenger's icon blue again
// @author       joeytwiddle
// @match        https://www.messenger.com/*
// @grant        none
// ==/UserScript==

// With some help from https://stackoverflow.com/questions/16745773/embed-favicon-using-a-userscript

// TODO: When a notification appears, it destroys our icon.  We need to display an icon with a dot.  I have a feeling we already tackled this behaviour in another script.

(function() {
    'use strict';

    var favicon = document.querySelector('link[rel~="icon"]');
    var clone = favicon.cloneNode(true);
    clone.href = "data:image/png;base64,";
    favicon.parentNode.removeChild(favicon);
    document.head.appendChild(clone);
})();
